import React from "react";

export const Search = ({}) => {
  return (
    <>
      <div className="spacer" />
      <div className="container">
        <label className="input-label">What's you trash-can code?</label>
        <input type="text" className="input-field" />
      </div>
      <style jsx>{`
        .spacer {
          flex: 1;
        }
        .container {
          max-width: 500px;
          margin: auto;
          display: flex;
          flex-direction: column;
          align-items: center;
        }
        .input-label {
          font-size: 3vh;
        }
        .input-field {
          padding: 20px;
          font-size: 5vh;
        }
      `}</style>
    </>
  );
};

export default Search;
